INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (126001, 40011, 1, 325, 0, 2, 24001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 5, 2);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (126101, 40011, 1, 326, 0, 2, 24001, "お兄。\nきてくれて、うれしい", "プレシア", 6, 2);
